 number of clusters\n","km.res <- kmeans(df, centers = optimal_k, nstart = 25)\n","\n","# Visualize the clustering results\n","plot(df, col = km.res$cluster, pch = 19, main = \"K-means Clustering\")\n","\n","# Print the k-means results\n","print(km.res)\n","\n","# Check which record belongs to which cluster\n","cluster_labels <- km.res$cluster\n","print(cluster_labels)\n","\n","# Cluster sizes\n","cluster_sizes <- table(km.res$cluster)\n","print(cluster_sizes)"]},{"cell_type":"code","execution_count":5,"id":"53bee2af","metadata":{"_cell_guid":"26bc53ab-1c83-47c6-892d-11c7290216e5","_uuid":"ada23e88-0aa6-4897-9e22-473640f81560","collapsed":false,"execution":{"iopub.execute_input":"2023-11-18T14:34:08.149731Z","iopub.status.busy":"2023-11-18T14:34:08.148205Z","iopub.status.idle":"2023-11-18T14:34:09.456743Z","shell.execute_reply":"2023-11-18T14:34:09.454665Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":1.325384,"end_time":"2023-11-18T14:34:09.462776","exception":false,"start_time":"2023-11-18T14:34:08.137392","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Warning message in pf(beale, pp, df2):\n","NaNs produced\n"]},{"name":"stdout","output_type":"stream","text":["*** : The Hubert index is a graphical method of determining the number of clusters.\n","                In the plot of Hubert index, we seek a significant knee that corresponds to a \n","                significant increase of the value of the measure i.e the significant peak in Hubert\n","                index second differences plot. \n"," \n"]},{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd0BV5eMG8OeyLtN7GSIoTly4N5paLgS3lVtxfKUsB46yco8yV+6dmgMF1J8z\n00xNCwdmpKI4IhRzgQKykcu4vz8gJ8Jl3feee5/PX3DOCZ5v3zw+9z3veV+ZWq0GEREREUmf\nkegARERERFQyWOyIiIiI9ASLHREREZGeYLEjIiIi0hMsdkRERER6gsWOiIiISE+w2BERERHp\nCRY7IiIiIj3BYkdERESkJ1jsiIiIiPQEix0RERGRnmCxIyIiItITLHZEREREeoLFjoiIiEhP\nsNgRERER6QkWOyI