es\n","cluster_sizes <- table(km.res$cluster)\n","print(cluster_sizes)"]},{"cell_type":"code","execution_count":6,"id":"de09527e","metadata":{"_cell_guid":"7ce1ddd8-f526-44d7-b2b6-aa2cfbb836f6","_uuid":"4ff17de4-739a-4d0f-9932-dc2c28723765","collapsed":false,"execution":{"iopub.execute_input":"2023-11-18T14:34:09.494736Z","iopub.status.busy":"2023-11-18T14:34:09.492987Z","iopub.status.idle":"2023-11-18T14:34:09.58239Z","shell.execute_reply":"2023-11-18T14:34:09.580434Z"},"jupyter":{"outputs_hidden":false},"papermill":{"duration":0.108912,"end_time":"2023-11-18T14:34:09.585215","exception":false,"start_time":"2023-11-18T14:34:09.476303","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzde0BUdcL/8TMOgsIoFy8IagRhXlLXNAXkziqCBpqSYpKaSKEV00UX1y4M20Wl\ntRAVL6FitojiDVkZ5UEihsBcXS9p6qqFKF5RRFRQLvP7w35WZjgq8GVm3q+/7Mx5xvfu/vF8\nOjNnjkyr1UoAAADQfy1EBwAAAKBhMOwAAAAMBMMOAADAQDDsAAAADATDDgAAwEAw7AAAAAwE\nww4AAMBAMOwAAAAMBMMOAADAQDDsAAAADATDDgAAwEAw7AAAAAwEww4AAMBAMOwAAAAMBMMO\nAADAQDDsAAAADATDDgAAwEAw7AAAAAwEww4AAMBAMOwAAAAMBMMOAADAQDDsAAAADATDDgAA\nwEAw7AAAAAwEww4AAMBAMOwAAAAMBMMOAADAQDDsAAAADATDDgAAwEAw7AAAAAwEww4AAMBA\nMOwAAAAMBMMOAADAQDDsAAAADATDDgAAwEAw7AAAAAwEww4AAMBAMOwAAAAMBMMOAADAQDDs\nAAAADATDDgAAwEAw7AAAAAwEww4AAMBAMOwAAAAMBMMOAADAQDDsAAAADATDDgAAwEAw7AAA\nAAwEww4AAMBAMOwAAAAMBMMOAADAQDDsAAAADATDDgAAwEAw7AAAAAwEww4AAMBAMOwAAAAM\nBMMOAADAQDDsAAAADATDDgAAwEAw7AAAAAwEww4AAMBAMOwAAAAMBMMOAADAQDDsAAAADATD\nDgAAwEAw7AAAAAwEww4AAMBAMOwAAAAMBMMOAADAQDDsAAAADATDDgAAwEAw7AAAAAwEww4A\nAMBAMOwAAAAMBMMOAADAQDDsAAAADATDDgAAwEAw7AAAAAwEww4AAMBAMOwAAAAMhInogMdV\nd/tCzr+3HzxRUmdm1eNZ9wDPv5jIRDcBAACIoE/DztfXt3X7FzLTou4eOb750+GvxJ4ov333\nSLte/klp60b1shIRCAAAIJJMq9WKbtCVTCZT2L9RUbLwzj+WH0+07/lmpbalf9irfgN627eR\nDn2vTkzaWmX2dPbZ/V6WZmJrAQAAmpgeD7vEZzu+caA0ZntRjP8Td8+5UDC/s8fMJ17I+Gnj\nCEGZAAAAYujxsHvKvGVph1nlpz6657RPn7L+R2nPqvKCJg8EAAAQSY/vii2trlM4uP/x+HNP\nKqpvHGr6HgAAALH0eNhN7GRxvbjwj8c1