ting the dataset into the Training set and Test set\n","library(caTools)\n","split = sample.split(d$Production, SplitRatio = 0.8)\n","training_set = subset(d, split == TRUE)\n","test_set = subset(d, split == FALSE)\n","\n","\n","\n","\n","\n","# Fitting Multiple Linear Regression to the Training set\n","regressor = lm(formula = Production ~ .,\n","               data = training_set)\n","\n","# Predicting the Test set results\n","y_pred = predict(regressor, newdata = test_set)\n","\n","# Other useful functions \n","confint(regressor, level=0.95) # CIs for model parameters \n","fitted(regressor) # predicted values\n","anova(regressor) # anova table \n","\n","\n","# Building the optimal model using Backward Elimination\n","regressor = lm(formula = Production ~ Area + Avg_temp + Rainfall + Humidity + Soil,\n","               data = d)\n","summary(regressor)\n","\n","# diagnostic plots \n","layout(matrix(c(1,2,3,4),2,2)) # optional 4 graphs/page \n","plot(regressor)\n","\n","# Plot matrix of all variables.\n","newdata = training_set[,c(1:6)]\n","summary(newdata)\n","plot(newdata, pch=16, col=\"blue\", main=\"Matrix Scatterplot of Area,Avg_teap,Rainfall,Humidity,Soil and production\")"]},{"cell_type":"code","execution_count":14,"id":"df673217","metadata":{"execution":{"iopub.execute_input":"2023-11-18T14:34:12.524811Z","iopub.status.busy":"2023-11-18T14:34:12.523142Z","iopub.status.idle":"2023-11-18T14:34:12.844146Z","shell.execute_reply":"2023-11-18T14:34:12.841441Z"},"papermill":{"duration":0.35754,"end_time":"2023-11-18T14:34:12.848608","exception":false,"start_time":"2023-11-18T14:34:12.491068","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdZ3wU1d4H8HNma3pvhISEGkqClNA7KiDFAgKCgI+oKN12xcLFrtd7bTQrIoqK\nIiC9hd57hwQSCCW9b8r2Oc+LTZYlyW42ydbh931xP5uZM3P+O+N1f56ZOUMZYwQAAAAA3B/n\n7AIAAAAAwDYQ7AAAAAAEAsEOAAAAQCAQ7AAAAAAEAsEOAAAAQCAQ7AAAAAAEAsEOAAAAQCAQ\n7AAAAAAEAsEOAAAAQC